import React from 'react';
import css from './Profile.module.css'
import MyPosts from './MyPosts/MyPosts';
import Description from './Description/Description';

const Profile = () => {
    return (
        <div className={css.profile}>
        <div className={css.profile__top}>
          <img alt="img" src="https://wallpapershome.ru/images/pages/pic_h/18847.jpg"></img>
        </div>

        <div className={css.profile__info}>
          <div className={css.profile__avatar}>
            <img src="https://scontent-hel2-1.cdninstagram.com/v/t51.2885-19/s150x150/83175097_608160346627556_1983433867435966464_n.jpg?_nc_ht=scontent-hel2-1.cdninstagram.com&_nc_ohc=I6kC_JJCgZIAX_qJjLq&oh=732502044e9338ee2b5b63e7f40b23d4&oe=5EB726D1" alt="avatar"></img>
          </div>

          <Description />
        </div>

        <MyPosts />
      </div>
    )
}

export default Profile;
